import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const fname = "Akash";
const lname = "Singh";
var date = new Date();

function Heading(){
    return(
        <>
        <h1 className='heading'> <b>Favorite Netfix Movie</b>  </h1> 
   <p> Only in english</p>
   <h2> {`My nick name is  ${fname} ${lname}
        and  age is  ${29+5} and date is ${date.toLocaleDateString()} and  time is  ${date.toLocaleTimeString()}`} 
    </h2>
        </>
    );

}
export default Heading;
